import React from 'react'
import NoteCard from './NoteCard'

const NotesList = (props) => {

    const NotesList = props.passNotesList;
    const RenderNotes = props.passNotesList.map((each) =>{
        console.log(each);
        return(
            <div >
                <NoteCard passNotesList={NotesList}/>
            </div>            
        );
    } )

    return (
        <div className="ui grid">
            {RenderNotes}
        </div>
    )
}

export default NotesList
